import React from 'react';

import { useNavigate } from 'react-router-dom';

import wishImage from '../../image/wishList.png';
import classes from './wishListEmpty.module.css';

function WishListEmpty(props){
    let navigate = useNavigate(); 

    function toHome(){ 
        let path = `/home`; 
        navigate(path);
    }
    return(
        <div className={classes.emptyBag}>
            <img src = {wishImage} alt = "List"></img>
            <p>YOUR WISHLIST IS EMPTY</p>
            <p className={classes.subHead}>Add items that you like to your wishlist. Review </p>
            <p className={classes.subHead}>them anytime and easily move them to the bag.</p>
            <button type='button' onClick={toHome}>CONTINUE SHOPPING</button>
        </div>
    );
}

export default WishListEmpty;
